import React, { useState } from 'react';
import './FilterBuilder.css';

const initialModules = [
  { id: '1', content: 'rb', type: 'attribute' },
  { id: '2', content: 'drb', type: 'attribute' },
  { id: '3', content: 'galactic_latitude', type: 'attribute' },
  { id: '4', content: 'jd', type: 'attribute' },
  { id: '5', content: 'jdstarthist', type: 'attribute' },
  { id: '6', content: 'AND', type: 'operator' },
  { id: '7', content: 'OR', type: 'operator' },
  { id: '8', content: '<', type: 'comparator' },
  { id: '9', content: '<=', type: 'comparator' },
  { id: '10', content: '==', type: 'comparator' },
  { id: '11', content: '>', type: 'comparator' },
  { id: '12', content: '>=', type: 'comparator' },
  { id: '13', content: '!=', type: 'comparator' },
  { id: '14', content: 'Number', type: 'input' },
];

const sampleDocuments = [
  { rb: 0.5, drb: 0.2, galactic_latitude: 5, jd: 2460318.5, jdstarthist: 2460314.5 },
  { rb: 0.5, drb: 0.99, galactic_latitude: -5, jd: 2460318.5, jdstarthist: 2460314.5 },
  { rb: 0.5, drb: 0.99, galactic_latitude: 30, jd: 2460318.5, jdstarthist: 2460300.5 },
  { rb: 0.9, drb: 0.8, galactic_latitude: 30, jd: 2460318.5, jdstarthist: 2460314.5 },
];

const FilterBuilder = () => {
  const [workspace, setWorkspace] = useState([]);
  const [inputValue, setInputValue] = useState('');
  const [editingIndex, setEditingIndex] = useState(null);
  const [filterExpression, setFilterExpression] = useState('');
  const [filterResults, setFilterResults] = useState([]);

  const handleModuleClick = (module) => {
    const newModule = { ...module, id: `${module.id}-${Date.now()}` };
    setWorkspace([...workspace, newModule]);
    if (module.type === 'input') {
      setEditingIndex(workspace.length);
    }
  };

  const handleRemoveModule = (index) => {
    const newWorkspace = Array.from(workspace);
    newWorkspace.splice(index, 1);
    setWorkspace(newWorkspace);
  };

  const handleClearWorkspace = () => {
    setWorkspace([]);
  };

  const handleAddAttribute = () => {
    const attributeName = prompt('Enter the name of the new attribute:');
    if (attributeName) {
      const newAttribute = {
        id: `attr-${Date.now()}`,
        type: 'attribute',
        content: attributeName,
      };
      setWorkspace([...workspace, newAttribute]);
    }
  };

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleAddInputModule = (index) => {
    const newWorkspace = Array.from(workspace);
    newWorkspace[index].content = inputValue;
    setWorkspace(newWorkspace);
    setInputValue('');
    setEditingIndex(null);
  };

  const handleModuleDoubleClick = (index) => {
    handleRemoveModule(index);
  };

  const handleKeyPress = (e, index) => {
    if (e.key === 'Enter') {
      handleAddInputModule(index);
    }
  };

  const handleCreateFilter = () => {
    const placeholderGroup = {
      id: `placeholder-group-${Date.now()}`,
      type: 'placeholder-group',
      content: [
        { id: `placeholder-1-${Date.now()}`, content: 'Drop here', type: 'placeholder' },
        { id: `placeholder-2-${Date.now()}`, content: 'Drop here', type: 'placeholder' },
        { id: `placeholder-3-${Date.now()}`, content: 'Drop here', type: 'placeholder' },
      ],
    };
    setWorkspace([...workspace, placeholderGroup]);
  };

  const handleDragStart = (e, index) => {
    e.dataTransfer.setData('moduleIndex', JSON.stringify(index));
  };

  const handleDragOver = (e) => {
    e.preventDefault();
  };

  const handleDrop = (e) => {
    e.preventDefault();
    const draggedIndex = e.dataTransfer.getData('moduleIndex');
    const newWorkspace = Array.from(workspace);
    newWorkspace[index] = {
      ...newWorkspace[index],
      left: e.clientX - e.target.getBoundingClientRect().left,
      top: e.clientY - e.target.getBoundingClientRect().top,
    };
    setWorkspace(newWorkspace);
  };

  const handleDropOnPlaceholder = (e, placeholderIndex, groupIndex) => {
    e.preventDefault();
    const module = JSON.parse(e.dataTransfer.getData('module'));
    const newWorkspace = Array.from(workspace);
    newWorkspace[groupIndex].content[placeholderIndex] = module;
    setWorkspace(newWorkspace);
  };

  const convertWorkspaceToFilterFunction = () => {
    const buildExpression = (modules) => {
      let expression = '';
      modules.forEach((module) => {
        if (module.type === 'attribute') {
          expression += `doc.${module.content} `;
        } else if (module.type === 'operator' || module.type === 'comparator') {
          expression += `${module.content} `;
        } else if (module.type === 'input') {
          expression += `${module.content} `;
        } else if (module.type === 'placeholder-group') {
          expression += '(';
          module.content.forEach((placeholder, idx) => {
            if (placeholder.type !== 'placeholder') {
              expression += `${placeholder.content} `;
            }
            if (idx < module.content.length - 1) {
              expression += ' ';
            }
          });
          expression += ')';
        }
      });
      return expression;
    };

    const filterFunction = (doc) => {
      const expression = buildExpression(workspace);
      try {
        return eval(expression);
      } catch (error) {
        console.error('Error evaluating filter expression:', error);
        setFilterResults([{ error: 'Invalid filter expression. Please check your filter and try again.' }]);
        return false;
      }
    };

    return filterFunction;
  };

  const handleRunFilter = () => {
    const filterFunction = convertWorkspaceToFilterFunction();
    const results = sampleDocuments.filter(filterFunction);
    setFilterResults(results);
  };

  const handleClearResults = () => {
    setFilterResults([]);
  };

  return (
    <div className="filter-builder">
      <div className="module-palette">
        <div className="attributes-operators">
          <h3>Attributes</h3>
          {initialModules.filter(module => module.type === 'attribute').map((module) => (
            <div
              key={module.id}
              className="module"
              draggable
              onDragStart={(e) => handleDragStart(e, module)}
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
          <h3>Operators</h3>
          {initialModules.filter(module => module.type === 'operator').map((module) => (
            <div
              key={module.id}
              className="module"
              draggable
              onDragStart={(e) => handleDragStart(e, module)}
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
        </div>
        <div className="comparators-input">
          <h3>Comparators</h3>
          {initialModules.filter(module => module.type === 'comparator').map((module) => (
            <div
              key={module.id}
              className="module"
              draggable
              onDragStart={(e) => handleDragStart(e, module)}
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
          <h3>Inputs</h3>
          {initialModules.filter(module => module.type === 'input').map((module) => (
            <div
              key={module.id}
              className="module"
              draggable
              onDragStart={(e) => handleDragStart(e, module)}
              onClick={() => handleModuleClick(module)}
            >
              {module.content}
            </div>
          ))}
        </div>
      </div>
      <div className="graph-workspace-container">
        <div className="graph-workspace">
        {workspace.map((module, index) => (
          module.type === 'placeholder-group' ? (
            <div key={module.id} className="placeholder-group">
              {module.content.map((placeholder, idx) => (
                <div
                  key={placeholder.id}
                  className={`module placeholder ${idx === 1 ? 'middle' : ''}`}
                  onDragOver={handleDragOver}
                  onDrop={(e) => handleDropOnPlaceholder(e, idx, index)}
                >
                  {placeholder.content}
                </div>
              ))}
              <div className="line left-line"></div>
              <div className="line right-line"></div>
            </div>
          ) : (
            <div
              key={module.id}
              className="module"
              draggable
              onDragStart={(e) => handleDragStart(e, module, index)}
              onDragOver={handleDragOver}
              onDrop={(e) => handleDrop(e, index)}
              onDoubleClick={() => handleModuleDoubleClick(index)}
            >
              {editingIndex === index ? (
                <input
                  type="text"
                  value={inputValue}
                  onChange={handleInputChange}
                  onKeyDown={(e) => handleKeyPress(e, index)}
                  placeholder="Enter value"
                />
              ) : (
                module.content
              )}
            </div>
          )
        ))}
        </div>
        <div className="button-container">
          <button className="create-filter-button" onClick={handleCreateFilter}>Create Filter</button>
          <button className="add-attribute-button" onClick={handleAddAttribute}>Add Attribute</button>
          <button className="clear-button" onClick={handleClearWorkspace}>Clear Workspace</button>
          <button className="run-button" onClick={handleRunFilter}>Run</button>
          <button className="clear-results-button" onClick={handleClearResults}>Clear Results</button>
        </div>
        {filterExpression && (
          <div className="filter-expression">
            <h3>Generated Filter:</h3>
            <p>{filterExpression}</p>
          </div>
        )}
        {filterResults.length > 0 && (
          <div className="filter-results">
            <h3>Filter Results:</h3>
            <pre>{JSON.stringify(filterResults, null, 2)}</pre>
          </div>
        )}
      </div>
    </div>
  );
};

export default FilterBuilder;
